svg.script:
(function() {
  var svg = document.getElementById('map');
  var tooltip = svg.getElementById('tooltip');
  var tooltipText = tooltip.getElementsByTagName('text')[0];
  var statenameText = svg.getElementsByClassName('statename')[0];
  var redText = svg.getElementsByClassName('redline')[0];
  var blueText = svg.getElementsByClassName('blueline')[0];
  var tooltipRects = tooltip.getElementsByTagName('rect');
  var triggers = svg.getElementsByClassName('tooltip-trigger');

  for (var i = 0; i < triggers.length; i++) {
    triggers[i].addEventListener('mousemove', showTooltip);
    triggers[i].addEventListener('mouseout', hideTooltip);
  }

  function showTooltip(evt) {
    var CTM = svg.getScreenCTM();
    var x = (evt.clientX - CTM.e + 6) / CTM.a;
    var y = (evt.clientY - CTM.f + 20) / CTM.d;
    tooltip.setAttributeNS(null, "transform", "translate(" + x + " " + y + ")");
    tooltip.setAttributeNS(null, "visibility", "visible");

    tooltipText.firstChild.data = evt.target.getAttributeNS(null, "data-tooltip-text");
    redText.firstChild.data = evt.target.getAttributeNS(null, "data-tooltip-red");
    blueText.firstChild.data = evt.target.getAttributeNS(null, "data-tooltip-blue");
    statenameText.firstChild.data = evt.target.getAttributeNS(null, "data-tooltip-text");


    var length = statenameText.getComputedTextLength();
    var length2 = redText.getComputedTextLength();

    console.log(length);
    for (var i = 0; i < tooltipRects.length; i++) {
      tooltipRects[i].setAttributeNS(null, "width", length + length2);
    }
  }

  function hideTooltip(evt) {
    tooltip.setAttributeNS(null, "visibility", "hidden");
  }

  function makeid(length) {
     var result           = '';
     var characters       = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
     var charactersLength = characters.length;
     for ( var i = 0; i < length; i++ ) {
        result += characters.charAt(Math.floor(Math.random() * charactersLength));
     }
     return result;
  }




})()
